import React from "react";
import { ResponsiveRadar } from "@nivo/radar";
// make sure parent container have a defined height when using
// responsive component, otherwise height will be 0 and
// no chart will be rendered.
// website examples showcase many properties,
// you'll often use just a few of them.
import Data from "../Data/DimensionActive";
const data = Data;
export default function MyResponsiveRadar() {
  return (
    <ResponsiveRadar
      data={data}
      indexBy="subject"
      maxValue="auto"
      margin={{ top: 70, right: 80, bottom: 40, left: 80 }}
      curve="linearClosed"
      borderWidth={3}
      borderColor={{ from: "color", modifiers: [] }}
      gridLevels={11}
      gridShape="linear"
      gridLabelOffset={30}
      enableDots={true}
      dotSize={5}
      dotColor={{ theme: "background" }}
      dotBorderWidth={2}
      dotBorderColor={{ from: "color" }}
      enableDotLabel={true}
      dotLabel="value"
      dotLabelYOffset={-12}
      colors={{ scheme: "pastel1" }}
      fillOpacity={0.6}
      blendMode="normal"
      animate={true}
      motionStiffness={140}
      motionDamping={11}
      isInteractive={true}
      legends={[
        {
          anchor: "top-left",
          direction: "column",
          translateX: -50,
          translateY: -40,
          itemWidth: 80,
          itemHeight: 20,
          itemTextColor: "#999",
          symbolSize: 12,
          symbolShape: "circle",
          effects: [
            {
              on: "hover",
              style: {
                itemTextColor: "#000",
              },
            },
          ],
        },
      ]}
    />
  );
}
